import React, { Component } from 'react';
import authService from '../../services/auth-service';
import { withAuthConsumer } from '../../contexts/AuthStore';
import imagesAvatar from '../../data/imagesAvatar';
import { Button, Collapse } from 'react-bootstrap';
import { Redirect } from 'react-router-dom';



const avatar = Object.values(imagesAvatar)

const validations = {
  name: (value) => {
    let message;
    if(!value){
      message = 'Name is required'
    }
    return message;
  },
  surname: (value) => {
    let message;
    if(!value){
      message = 'Surname is required'
    }
    return message;
  }
}

class Profile extends Component {
  state = {
    user: {
      name: this.props.user.name,
      surname: this.props.user.name,
      imageURL: this.props.user.imageURL
    },
    errors: {
      name: validations.name(),
      surname: validations.surname()
    },
    touch: {},
    selector:false
  }





  handleChange = (event) => {
    const { name, value } = event.target;
    this.setState({
      user: {
        ...this.state.user,
        [name]: value
      },
      errors: {
        ...this.state.errors,
        [name]: validations[name] && validations[name](value)
      }
    })
  }

  handleBlur = (event) => {
    const { name } = event.target;
    this.setState({
      touch: {
        ...this.state.touch,
        [name]: true
      }
    })
  }

  handleSubmit = (event) => {
    event.preventDefault();

    authService.editProfile(this.state.user)
    .then(<Redirect to="" />)

  }

  handleSelectImage = (img) => {
    this.setState({
      user: {
        ...this.state.user,
        imageURL: img
      }
    })
  }


  render(){
    const { user, errors, touch, selector } = this.state;

    return(
      <div className="profile shadow-sm">
        <div className="login-body">
          <p>Hi {user.name}, you can change your profile information except your email</p>
            <form onSubmit={this.handleSubmit}>
              <div className="form-group">
                <label htmlFor="nameRegister">Name</label>
                <input type="text" 
                  className={`form-control ${touch.name && errors.name && 'is-invalid'}`} 
                  id="nameRegister" 
                  name="name"
                  placeholder="Name..."
                  onChange={this.handleChange}
                  onBlur={this.handleBlur}
                  value={user.name}
                  />
                  <div className="invalid-feedback">{errors.name}</div>
              </div>
              <div className="form-group">
                <label htmlFor="surnameRegister">Surname</label>
                <input type="text"
                  className={`form-control ${touch.surname && errors.surname && 'is-invalid'}`} 
                  id="surnameRegister" 
                  name="surname"
                  placeholder="Surname..."
                  onChange={this.handleChange}
                  onBlur={this.handleBlur}
                  value={user.surname}
                  />
                  <div className="invalid-feedback">{errors.surname}</div>
              </div>
              <div>
                <img src={user.imageURL} alt="profile" className="image-profile"/>
                <Button
                  onClick={() => this.setState({ selector: !selector })}
                  aria-controls="collapse-pay"
                  aria-expanded={selector}
                  variant="outline-secondary"
                >
                  Select other image
                </Button>
                <Collapse in={selector}>
                  <div id="collapse-attach">
                    <div className="row p-2">
                      {avatar.map((img, index) => 
                      <div key={index} 
                        onClick={() => this.handleSelectImage(img)}
                        className={`student 
                          ${user.imageURL.includes(img) && 'student-selected'}`}
                        >
                        <img src={img} alt="avatar" className="image-profile-selector"/>
                      </div>
                      )}
                    </div>
                  </div>
                </Collapse>
              </div>
                <button type="submit" className="btn btn-info w-100 mt-3">Save changes</button>
            </form>
        </div>
      </div>
    )
  }
}

export default withAuthConsumer(Profile);
